let bin = ""

import {ethers} from "ethers"
import {RPC_URL,OWNER_1_ADDRESS,OWNER_1_PRIVATE_KEY,SAFE_ADDRESS,ERC721_ADDRESS} from '../config'
const l2Provider = new ethers.JsonRpcProvider(RPC_URL)
const wallet = new ethers.Wallet(OWNER_1_PRIVATE_KEY,l2Provider)

let contractAddress = ERC721_ADDRESS;
async function main(){
    await deploy();
	await transferOwnership();
}

async function mint(){
    var contract = new ethers.Contract(contractAddress,abi,wallet);
    let symbol = await contract.symbol()	
    console.log('symbol:',symbol)

    var to = OWNER_1_ADDRESS
    var tx = await contract.mint(to,6,{
		maxPriorityFeePerGas:5000000,
		gasLimit:100000
	})
	
    await tx.wait();
    console.log("mint",tx.hash);

    // let balance = await contract.balanceOf(to)
    // console.log('balance:',balance.toNumber())
}

async function transferOwnership(){
	var contract = new ethers.Contract(contractAddress,abi,wallet);

    var to = SAFE_ADDRESS
    var tx = await contract.transferOwnership(to)
    await tx.wait();
    console.log('tranferOwnership,tx:',tx.hash);
}

async function deploy(){
    var factory = new ethers.ContractFactory(abi,bin,wallet)
     let contract = await factory.deploy("ERC721 TEST","HEL",{
        gasLimit: 10000000});

	await contract.waitForDeployment()
	contractAddress = await contract.getAddress()
    console.log(contractAddress)
}
main();